import React from "react";
// import Temp from "./Temp";
import web from '../src/images/bg1.svg';
import { NavLink } from "react-router-dom";

const About = () => {
  // const image={
  //   height:'29rem',
  //   width:'29rem',
  //   marginRight:'0 !important',
  //   border:'2px solid black',
  //   gap:'5rem'
  // }
  return (
    <>
      <section id="header" className="d-flex align-items-center">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
            <div className="row">
              <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                <h1>
                <br/>
                <strong className="brand-name">Harsh rathod</strong></h1>
                <p className="my-3">We are the team of the talanted developer making website</p>
                <div className="mt-3">
                  <NavLink to="/service" className="btn btn-outline-primary">Get Started</NavLink>
                </div>
              </div>
              <div className="col-lg-6 order-1 order-lg2 header-img d-flex align-items-center">
                <img src={web} className="img-fluid animated" alt="homeimg"></img>
              </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>);
}
export default About;
